    remained depressed. Environmental conditions of the late spring were partially responsible,
    but do not fully explain decreased production since densities, success and clutch
    sizes do not differ significantly from 1984, which was an average year in regard
    to environmental conditions. Clearly, several interrelated factors having variable
    effects between years control goose production on the YK Delta.",nt"owner_org":
